original_text:
The Vanity Mile (formerly the Vanity Invitational Handicap) is an American Thoroughbred horse [[race]] once run annually in June at Hollywood Park [[Racetrack]] in Inglewood, California but due to that [[track's]] closure is now (from 2014) run at Santa Anita Park. Open by invitation to fillies and mares aged three years and up, the Grade I stakes [[race]] was run at a distance of one and one-eighth miles. It was raced on [[dirt]] since its inaugural running in 1940 until 2007 after the new synthetic Cushion Track had been installed. In 2016 it was announced that the [[race]] would be renamed the Vanity Mile and the distance reduced accordingly. The race has been contested at various distances: 
* 1 mile - 1940; 2016 
*  1 1⁄16 miles - 1941, 1944–1949, 1951–1953; 
*  1 1⁄8 miles - 1950, 1954–1985, 1988–present; 
*  1 1⁄4 miles - 1986–1987.

